<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Redirecting...</title>
    <script>
        // Redirect URL
        const targetUrl = "https://secrano.github.io/archive/front46/index.html"; // Replace with your target URL

        // Redirect after a delay (e.g., 1 seconds)
        setTimeout(() => {
            window.location.href = targetUrl;
        }, 1000); // Delay in milliseconds (1000ms = 1 seconds)
    </script>
</head>
<body>
    <h1>Redirecting...</h1>
    <p>
    <p>If you are not redirected automatically, <a href="https://secrano.github.io/archive/front46/index.html">click here</a>.</p>
</body>
</html>
